import React from 'react';
import './Circle.css';
import img_contour from './../images/contour.png';
import svg_crowm from './../images/svg/Vector.svg';
import img_placeholder from './../images/placeholder/placeholder.png';


const crown_elements = [
  {svg_circles_name: "crown_svg", div_name: "div_tool_1", svg_circle_name: "svg_circle_name1", svg_element_name: "1_3"},
  {svg_circles_name: "crown_svg", div_name: "div_tool_2", svg_circle_name: "svg_circle_name2", svg_element_name: "2_3"},
  {svg_circles_name: "crown_svg", div_name: "div_tool_3", svg_circle_name: "svg_circle_name3", svg_element_name: "3_3"},
  {svg_circles_name: "crown_svg", div_name: "div_tool_4", svg_circle_name: "svg_circle_name4", svg_element_name: "4_3"},
  {svg_circles_name: "crown_svg", div_name: "div_tool_5", svg_circle_name: "svg_circle_name5", svg_element_name: "5_3"},
  {svg_circles_name: "crown_svg", div_name: "div_tool_6", svg_circle_name: "svg_circle_name6", svg_element_name: "6_3"}
]

const crown_buttons = crown_elements.map((crown_element) =>
  <div className={crown_element.div_name}>
    <svg
      viewBox="0 0 40 40"
      xmlns="http://www.w3.org/2000/svg"
      class={crown_element.svg_circles_name + " " + crown_element.svg_circle_name}>
      <circle
        cx="20"
        cy="20"
        r="20"/>
    </svg>
    <img
      className="${crown_element.svg_element_name}"
    />
  </div>
);

const Big_circle = () => {
  return (
    <div className = "Big_circle">
      <svg viewBox="0 0 40 35" xmlns="http://www.w3.org/2000/svg" class="svg_big_circle">
        <circle cx="20" cy="15" r="20" />
      </svg>
    </div>
  );
}

const Crown = () => {
  return (
    <div className ="Crown">
      <img
        src={svg_crowm}
        className ="img_crowm"
      />
      <div className ="crown_buttons">
        {crown_buttons}
      </div>
    </div>
  );
}

const Medium_circle = () => {
  return (
    <div className="Medium_circle">
      <div className="div_svg_medium_circle">
        <svg viewBox="0 0 40 40" xmlns="http://www.w3.org/2000/svg" class="svg_medium_circle">
          <circle cx="20" cy="20" r="20" />
        </svg>
      </div>
      <Crown />
    </div>
  );
}

const Small_circle = () => {
  return (
    <div className="Small_circle">
      <div className="contour">
        <img
          src = {img_contour}
          className = "img_contour"
        />
      </div>
      <div className ="avatar">
        <img
          src= {img_placeholder}
          className ="img_avatar"
        />
      </div>
    </div>
  );
}


const Circle = () => {
  return (
    <div className = "Circle">
      <Big_circle />
      <Medium_circle />
      <Small_circle />
    </div>
  );
}

export default Circle;
